  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas dataset presents environmental
  benefits of the urban forest in 155 block groups in Green Bay, Wisconsin. Carbon
  attributes, temperature reduction, pollution removal and value, and runoff effects
  are calculated for each block group using i-Tree models (www.itreetools.org), local
  weather data, pollution data, EPA provided city boundary and land cover data, and
  U.S. Census derived block group boundary data. This dataset was produced by the
  US Forest Service to support research and online mapping activities related to EnviroAtlas.
  EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to interact with a
  web-based, easy-to-use, mapping application to view and analyze multiple ecosystem
  services for the contiguous United States. The dataset is available as downloadable
  data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas map
  service. Additional descriptive information about each attribute in this dataset
  can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets
  ).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
